import React from 'react';

function TaskQueue({user}) {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center">
      <div className="max-w-3xl w-full bg-white p-8 rounded-lg shadow-md">
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">Task Queue</h2>
        <div className="text-gray-600">
          <p className="mb-2">There are currently no tasks in the queue.</p>
          <p>You can check back later for updates or contribute by reporting garbage in your area.</p>
        </div>
      </div>
    </div>
  );
}

export default TaskQueue;
